INSERT INTO eg_mdms_data (id, tenantid, uniqueidentifier, schemacode, data, isactive, createdby, lastmodifiedby, createdtime, lastmodifiedtime) VALUES ('1a4c5770-a91a-44e5-8ea3-4fb903d64a11', 'pg', '1.Mehram Nagar Barat Ghar.MEHRAM_NAGAR_BARAT_GHAR.Village Mehram Nagar, Delhi Cantt', 'CHB.CommunityHalls', '{""code"": ""MEHRAM_NAGAR_BARAT_GHAR"", ""name"": ""Mehram Nagar Barat Ghar"", ""type"": ""HALL"", ""active"": true, ""address"": ""Village Mehram Nagar, Delhi Cantt"", ""remarks"": ""Note : Proposed 50% discount on rent based on special category (Cantt Board Staff, IDES Officer, Working Army Officer, Elected Member). Moreover the rate/charges have also been proposed to be revised. The matter is referred to the ensuing Board meeting for approval."", ""portalUrl"": """", ""disclaimer"": ""This is a digitally Signed Certificate and does not require hand written signatures. The responsibility of verification of this document, before accepting the same for any legal purpose, would rest with the Institution or Organization or Company or any other entity where this document is produced."", ""geoLocation"": ""28.564143,77.123490"", ""contactDetails"": ""011-25695450"", ""headerImageUrl"": """", ""communityHallId"": ""1"", ""hallDescription"": ""Two Halls, One Ground floor & One First floor. Can accomodate 200-250 people."", ""termsAndCondition"": ""The permission is accorded at following term and conditions:-\n1. Tentage etc. will be erected and removed during the permitted period only. In case of use beyond permitted booking period, penal rates at double the normal rates will be charged.\n2. The Municipal Corporation reserves the right to cancel the booking in public interest in the exigencies of the exception circumstances without assigning any reason.\n3. In case the cancellation is required the refund shall be as follows:\n   (i) If the request is made 1 month in advance to the date of booking - 50%.\n   (ii) Between less than 1 month and more than 15 days from the date of booking - 25%.\n   (iii) Less than 15 days from the date of booking - Nil.\n4. Permission to use Music System/Loud Speaker/Fire/Crackers has to be obtained from the competent authority. The DJ/ Loud Speaker shall be permitted inside the hall only.\n5. Permission for loudspeaker and liquor etc. shall be obtained by me at my own cost. The liquor can be served in the marriage functions only with the permission of the competent authority.\n6. I will ensure the compliance of noise pollution and other safety measures strictly.\n7. I understand that the booking is strictly prohibited for religious and political activities in the Community Centres.\n8. In case of Lawn of community centre, Janj Ghar the water, electricity connection is to be arranged by the consumer at his own cost.\n9. In case of payment failure, the applicant will be liable to be prosecuted as per law."", ""cancellationPolicy"": ""You can cancel your application any time before the date of event. GST will not be refunded. Also, a percentage of rent is deducted based on when you cancel your application with respect to the date of event. The day range and percentage amount deducted from rent during refund is shown in the table below. Earlier you cancel, lesser will be the amount deducted. All other charges like Security Deposit, Electricity Charges, Water Charges and Conservation fees will be refunded.\n0 days - 19 days before the date of event: 50% will be deducted from rent\n20 days - 90 days before the date of event: 10% will be deducted from rent\n91 days - above before the date of event: 0% will be deducted from rent.""}', TRUE, '11b0e02b-0145-4de2-bc42-c97b96264807', '11b0e02b-0145-4de2-bc42-c97b96264807', 1727351288277, 1727351288277);
